	SetConsoleCP(1251);
	SetConsoleOutputCP(1251);

	ifstream fin;
	fin.open("C:/Users/PC/Desktop/file.txt");

	ofstream fout;
	fout.open("C:/Users/PC/Desktop/file2.txt");

	if (!fin.is_open() || !fout.is_open()) {
		cout << "Ошибка открытия файла" << endl;
	}
	else {
		string str;

		getline(fin, str);
		if (!fin.eof()) {
