            cursor: pointer;
        }

        button:hover {
            background-color: #0056b3;
        }

        #linksContainer {
            margin-top: 20px;
        }

        a {
            color: #007bff;
            text-decoration: none;
        }

        a:hover {
            text-decoration: underline;
        }
    </style>
