def idek(st):
    l = ['zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine']
    s = []
    tem = ""
    for i in st:
        if i.isdigit():
            s.append(i)
            tem=""
        else:
            tem += i
            for j in l:
                if j in tem:
                    tem = ""
                    s.append(str(l.index(j)))
                    break

    return int("".join([s[0], s[-1]]))


