#include <iostream>
#include <array>
#include <chrono>
#include <stdio.h>

// Original, reformatted with added whitespace
void find_unique_1()
{
    int sample[8] = {12, 10, 12, 8, 9, 7, 11, 7};
    int j, flag;
    for (int i = 0; i < 8; i++)
    {
        j &= 0;
        flag &= 0;
        while (!(flag ^ 0) && j < 8)
        {
            if (!(j ^ i))
            {
                j++;
                continue;
            }
            if (!(*(sample + j) ^ *(sample + i)))
            {
                flag = 1;
            }
            j++;
        }
        if (!(flag ^ 0))
        {
            printf("Unique: %d\n", *(sample + i));
        }
    }
}

// Same as find_unique_1(), but removing bit manipulation
void find_unique_2()
{
    std::array<int, 8> sample{12, 10, 12, 8, 9, 7, 11, 7};
    for (int i = 0; i < 8; i++)
    {
        int flag{};
        for (int j = 0; (flag == 0) && (j < 8); j++)
        {
            if ((j != i) && (sample[j] == sample[i])) flag = 1;
        }
        if (flag == 0) printf("Unique: %d\n", sample[i]);
    }
}

int main()
{
    {
        auto start_time = std::chrono::steady_clock::now();

        for (std::uint64_t i = 0; i < 1'000'000; i++) find_unique_1();

        auto end_time = std::chrono::steady_clock::now();
        std::cout << "Elapsed time for find_unique_1: "
                  << std::chrono::duration_cast<std::chrono::milliseconds>(
                         end_time - start_time)
                         .count()
                  << " ms" << std::endl;
    }
    {
        auto start_time = std::chrono::steady_clock::now();

        for (std::uint64_t i = 0; i < 1'000'000; i++) find_unique_2();

        auto end_time = std::chrono::steady_clock::now();
        std::cout << "Elapsed time for find_unique_2: "
                  << std::chrono::duration_cast<std::chrono::milliseconds>(
                         end_time - start_time)
                         .count()
                  << " ms" << std::endl;
    }
}

