             'six' => 6, 'seven' => 7, 'eight' => 8, 'nine' => 9,
             map { $_ => $_ } (1 .. 9));

my $part2 = 0;
foreach (<>) {
    # first match
    m#(one|two|three|four|five|six|seven|eight|nine|\d)#;
    $part2 += 10 * $table{$1};

    # match with longest .* before
    m#^.*(one|two|three|four|five|six|seven|eight|nine|\d)#;
